script: |
  super -f text -I q8608.spq | sort > q8608.out

inputs:
  - name: q8608.spq
    data: |
      SELECT DISTINCT + 93 * - cor1.col0 - + ( + cor0.col0 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q8608.out
    data: |
      -654
      -715
      -7257
      -731
      -7318
      -7334
      -7350
      -7411
      -7427
